window.bookSummaryJSON = "<p>You're going to wish you never got this audiobook. Some facts are too terrifying to teach in school. Unfortunately, Cracked.com is more than happy to fill you in: A zombie apocalypse? It could happen. 50% of humans are infected with a parasite that can take over your brain. The FDA wouldn't let you eat bugs, right? Actually, you might want to put down those jelly beans. And that apple. And that strawberry yogurt. Think dolphins are our friends? Then these sex-crazed thrill killers of the sea have you right where they want you. The most important discovery in the history of genetics? Francis Crick came up with it while on LSD. Think you're going to choose whether or not to buy this audiobook? Scientists say your brain secretly makes all your decisions 10 seconds before you even know what they are.</p>"; 
